import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

class Production extends React.Component {
  render() {
    var names = ['Andrew', 'Ben', 'Charlie'];
    var namesList = names.map(function(name){
      return <li>{name}</li>;
    })
    return (
      <ul>{ namesList }</ul>
    );
  }
}

export default Production;

